import React from "react";
import "./ExtraInfo.css";

export default function ExtraInfo() {
  return (
    <div className="extra-info inline-block">
      <h2 className="extra-info-header">Looking for recipes?</h2>
      <p className="extra-info-text">
        Discover more than 1000 fantastic recipes with Sousmate. You will love
        them!
      </p>
    </div>
  );
}
